// rotate track 180
function rotFix() {
    let maxX = 0;
    let maxY = 0;
    let minX = walls[0][0];
    let minY = walls[0][1];

    // get track dimensions
    walls.forEach(line => {
        maxX = Math.max(maxX, line[0], line[2]);
        maxY = Math.max(maxY, line[1], line[3]);
        minX = Math.min(minX, line[0], line[2]);
        minY = Math.min(minY, line[1], line[3]);
    });

    // rotate walls 180
    walls.forEach(line => {
        line[0] = maxX - line[0];
        line[2] = maxX - line[2];
        line[1] = maxY - line[1];
        line[3] = maxY - line[3];
    });

    // guess at positions
    startingLine = [43, 0, 43, 7.4];

    // rotate racing lines 180
    __precalculatedRacingLines.forEach(line => {
        line.forEach(pair => {
            pair[0] = maxX - pair[0];
            pair[1] = maxY - pair[1];
        });
    });
}


